import React, { Component } from "react";
import Slider from "react-slick";
import styled from 'styled-components'
import { isBrowser } from "react-device-detect";

import girl from '../photos/girl.jpg'
import girl2 from '../photos/girl.jpg'
import girl3 from '../photos/girl.jpg'
import girl4 from '../photos/girl.jpg'
import girl5 from '../photos/girl.jpg'
import girl6 from '../photos/girl.jpg'

const Div = styled.div`
margin: 20px;
height:200px;
background-position:center;
background-repeat:no-repeat;
background-size:cover;
`

const H1 = styled.h1`
text-align:center;
color: grey;
`



export default class Girls extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 3,
            responsive: [
                {
                    breakpoint: 1024,
                    settings: {
                        slidesToShow: 3,
                        slidesToScroll: 3,
                        infinite: true,
                        dots: true
                    }
                },
                {
                    breakpoint: 600,
                    settings: {
                        slidesToShow: 2,
                        slidesToScroll: 2,
                        initialSlide: 2
                    }
                },
                {
                    breakpoint: 480,
                    settings: {
                        slidesToShow: 1,
                        slidesToScroll: 1
                    }
                }
            ]
        };
        return (
            <div >
                <div >
                    <H1> Möt våra medlemmar </H1>
                    <Slider {...settings} >
                        <div >
                            <a href={isBrowser ? "https://www.facebook.com/home.php#_=_" : "https://www.youtube.com/watch?v=kJ8WuCipnPg"}>
                                <Div style={{ cursor: "pointer", backgroundImage: `url(${girl})` }}></Div>
                                <H1>Ingrid</H1>
                            </a>
                        </div>
                        <div >
                            <Div style={{ cursor: "pointer", backgroundImage: `url(${girl})` }}></Div>
                            <H1>Ingrid</H1>
                        </div>
                        <div >
                            <Div style={{ cursor: "pointer", backgroundImage: `url(${girl})` }}></Div>
                            <H1>Ingrid</H1>
                        </div>
                        <div >
                            <Div style={{ cursor: "pointer", backgroundImage: `url(${girl})` }}></Div>
                            <H1>Ingrid</H1>
                        </div>
                        <div >
                            <Div style={{ cursor: "pointer", backgroundImage: `url(${girl})` }}></Div>
                            <H1>Ingrid</H1>
                        </div>
                        <div >
                            <Div style={{ cursor: "pointer", backgroundImage: `url(${girl})` }}></Div>
                            <H1>Ingrid</H1>
                        </div>
                    </Slider>
                </div>
            </div >
        );
    }
}
